const initialState = {
  teams:[],
  selectedPlayer:""
}

export default function reducer(state = initialState, action) {
  let newState = {...state}
  switch (action.type) {
    case "SELECT_PLAYER":
       newState.selectPlayer = "something"
      return newState
    default:
      return newState
  }
}
